/* ===== src/pages/Tutor/TutorHome.jsx ===== */
import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';
import { Container, Row, Col, Card, ListGroup, Button } from 'react-bootstrap';

export default function TutorHome() {
  const navigate = useNavigate();
  const [tutor, setTutor] = useState(null);
  const [meusPets, setMeusPets] = useState([]);
  const [meusEventos, setMeusEventos] = useState([]);
  const [filtroPet, setFiltroPet] = useState(null);

  useEffect(() => {
    const usuarioStr = localStorage.getItem('usuario_tutor');
    if (!usuarioStr) {
      alert('Você precisa estar logado como tutor.');
      navigate('/login-tutor');
      return;
    }
    const usuario = JSON.parse(usuarioStr);
    setTutor(usuario);

    // Buscar pets do tutor
    api.get('/pets')
      .then(res => {
        const petsFiltrados = res.data.filter(p => p.tutor === usuario._id);
        setMeusPets(petsFiltrados);
        // após ter pets, busca eventos
        fetchEventos(usuario._id);
      })
      .catch(() => alert('Erro ao buscar pets'));
  }, [navigate]);

  // Função para buscar eventos pelo tutor e opcionalmente por pet
  const fetchEventos = (tutorId, petId) => {
    let url = `/eventos?tutor=${tutorId}`;
    if (petId) url += `&pet=${petId}`;
    api.get(url)
      .then(res => {
        // mapear petName
        const eventosMap = res.data.map(evt => {
          const pet = meusPets.find(p => p._id === evt.pet);
          return { ...evt, petName: pet ? pet.nome : '' };
        });
        setMeusEventos(eventosMap);
      })
      .catch(() => alert('Erro ao buscar eventos'));
  };

  const handleLogout = () => {
    localStorage.removeItem('usuario_tutor');
    navigate('/login-tutor');
  };

  const handleFiltro = petId => {
    setFiltroPet(petId);
    fetchEventos(tutor._id, petId);
  };

  const formatDateTime = iso => new Date(iso).toLocaleString('pt-BR');

  if (!tutor) return <p>Carregando perfil...</p>;

  return (
    <Container className="mt-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Painel do Tutor</h2>
        <Button variant="secondary" onClick={handleLogout}>Sair</Button>
      </div>

      <Row>
        <Col md={4}>
          <Card className="mb-4 bg-white shadow-sm">
            <Card.Header className="bg-white">Meus Pets</Card.Header>
            <ListGroup variant="flush">
              <ListGroup.Item
                action
                active={!filtroPet}
                onClick={() => handleFiltro(null)}
              >
                Todos Pets
              </ListGroup.Item>
              {meusPets.map(pet => (
                <ListGroup.Item
                  key={pet._id}
                  action
                  active={filtroPet === pet._id}
                  onClick={() => handleFiltro(pet._id)}
                >
                  {pet.nome}
                </ListGroup.Item>
              ))}
            </ListGroup>
          </Card>
        </Col>

        <Col md={8}>
          <Card className="mb-4 bg-white shadow-sm">
            <Card.Header className="bg-white">Meus Eventos</Card.Header>
            <ListGroup variant="flush">
              {meusEventos.length === 0 ? (
                <ListGroup.Item>Nenhum evento registrado.</ListGroup.Item>
              ) : (
                meusEventos.map(evt => (
                  <ListGroup.Item key={evt._id} className="mb-3">
                    <div className="d-flex justify-content-between">
                      <div>
                        <strong>{evt.tipo}</strong> — <em>{evt.petName}</em>
                      </div>
                      <div>
                        <small>
                          Entrada: {formatDateTime(evt.dataEntrada)}<br />
                          Saída: {evt.dataSaida ? formatDateTime(evt.dataSaida) : 'Em andamento'}<br />
                          Status: {evt.status || (evt.dataSaida ? 'Finalizado' : 'Ativo')}
                        </small>
                      </div>
                    </div>
                    {evt.status === 'Ativo' && (
                      <Button
                        variant="warning"
                        size="sm"
                        className="mt-2"
                        onClick={() => navigate(`/pets/${evt.pet}/finish-event`)}
                      >
                        Finalizar Evento
                      </Button>
                    )}
                  </ListGroup.Item>
                ))
              )}
            </ListGroup>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}
